module Test.Record.Experiments.ToTreeEnum where

import Data.Kind
import Data.List
import Data.Proxy

import Test.Record.Experiments.Induction.Tree
import Test.Record.Experiments.Util (Tree(..), treeFromList)

{-------------------------------------------------------------------------------
  Generator for the ToTree type family cases below
-------------------------------------------------------------------------------}

_genToTree :: String
_genToTree = unlines $ map caseFor [0 .. 100]
  where
    caseFor :: Int -> String
    caseFor n = concat [
          "  ToTree '["
        , intercalate ", " args
        , "] = "
        , showTree (treeFromList args)
        ]
      where
        args :: [String]
        args = ["x" ++ show i | i <- [0 .. n - 1]]

    showTree :: Tree String -> [Char]
    showTree Zero           = "'Zero"
    showTree (One x)        = "'One " ++ x
    showTree (Two x1 x2)    = "'Two " ++ x1 ++ " " ++ x2
    showTree (Branch x l r) = "'Branch " ++ x
                           ++ " (" ++ showTree l ++ ")"
                           ++ " (" ++ showTree r ++ ")"


{-------------------------------------------------------------------------------
  Class with no role annotations

  We inherit the EmptyClass type from Tree.Induction though it's role annotation
  has the opposite effect here (we do better when it _doesn't_ have a phantom
  role). The flags (BLOG2_VARIANT_LOGARITHMIC versus BLOG2_VARIANT_QUADRATIC)
  are a bit of a misnomer for this case, but this is anyway just a postscript
  to the blog post.
-------------------------------------------------------------------------------}

requireEmptyClass :: EmptyClass (ToTree xs) => Proxy xs -> ()
requireEmptyClass _ = ()

{-------------------------------------------------------------------------------
  Generated instance

  By "precomputing" these instances, we avoid large coercions, because the
  type family evaluates in one step. Of course, as a consequence, we only have
  a fixed number of cases.
-------------------------------------------------------------------------------}

type family ToTree (xs :: [Type]) :: Tree Type where
